import Card from "react-bootstrap/Card";

const admin = () => {
  return (
    <div>
      <Card>
        <Card.Header className="cardTitle">
          Create Solidarity Institution
        </Card.Header>
        <Card.Body>
          <Card.Text></Card.Text>
          <Card.Text></Card.Text>
        </Card.Body>
      </Card>
      <Card>
        <Card.Header className="cardTitle">Create MIS</Card.Header>
        <Card.Body>
          <Card.Text></Card.Text>
          <Card.Text></Card.Text>
        </Card.Body>
      </Card>
    </div>
  );
};

export default admin;
